import{_ as t,o as a,c as o,p as c,m as n,k as e}from"./chunks/framework.6825d1fb.js";const r="/assets/image1.3f84ae7b.png";const S=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"researches/基于图像多级信息的信息提取和预判系统.md","filePath":"researches/基于图像多级信息的信息提取和预判系统.md","lastUpdated":1678237288000}'),d={name:"researches/基于图像多级信息的信息提取和预判系统.md"},s=_=>(c("data-v-78c9a20e"),_=_(),n(),_),p=s(()=>e("h1",null,"基于图像多级信息的信息提取和预判系统",-1)),i=s(()=>e("p",null,"随着深度学习和人工智能行业水平的不断提高，近来年，计算机视觉逐渐成为深度学习方面的热门领域，由于科研工作者们的研究需要，领域内对图像的需要越来越不容易满足，尤其有部分研究领域的专业图像有获取难度大、成像复杂以及在采集和运输过程中可能会导致的丢失或不完整等问题，严重降低了图像质量，其中的局部变形或伪影可能会影响后续的处理和分析，甚至根本无法使用，对有限的科研经费产生巨大的压力。为了解决目前存在的部分问题，我们提出了一种“基于图像多级信息的信息提取和预判系统”，我们的系统可以从未损坏图像中提取多种类、多尺度、有效地多级信息，通过从图像的已知部分提取边缘、结构、纹理等高级语义信息，通过深度学习方法将多种语义信息相结合，最终可以得到正确性高、完整性强、鲁棒性好的预判图像。使用我们方法修复的图片提取到的相关信息可以用于有限元仿真实验、语义分割、超分辨率和图像修复等领域，方便研究人员在我们的基础上进行开展各项实验。",-1)),l=s(()=>e("p",null,[e("img",{src:r,alt:"image1"})],-1)),m=[p,i,l];function h(_,u,f,g,v,x){return a(),o("div",null,m)}const $=t(d,[["render",h],["__scopeId","data-v-78c9a20e"]]);export{S as __pageData,$ as default};
